import awaitable
import sys

@awaitable
def process_single_sentence(s, i):
    return {"sentence": s, "location_index": i}

@awaitable
def process_many_sentences(s, i):
    all_results = []
    for word in s:
        all_results.append(await process_single_sentence(word, i))
    return all_results

